import React from 'react'
import { NavLink } from 'react-router-dom'

export const Navbar = () => {
  return (
    <nav>
      {/* <div className="nav-wrapper blue darken-1" style={{ padding: '0 2rem' }}> */}
        {/* <span className="brand-logo">Сокращение ссылок</span> */}
        <ul id="nav-mobile" className="right hide-on-med-and-down">
          <li className="hover hover-3"><NavLink to="/">Logo</NavLink></li>
          <li className="hover hover-3"><NavLink to="/cup">Кружки</NavLink></li>
          <li className="hover hover-3"><NavLink to="/t-shirt">Футболки</NavLink></li>
          <li className="hover hover-3"><NavLink to="/souvenirs">Сувениры</NavLink></li>
        </ul>
      {/* </div> */}
    </nav>
  )
}
